// react
import React from 'react';

// third-party
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

// application
import { LogoSvg } from '../../content/images/svg';

function LogoPanel(props) {
    const { layout } = props;

    let logo = null;

    if (layout === "mobile") {
        logo = (
            <div className="nav-panel__logo">
                <Link to="/" className="ekat-header__logo-link">
                    <span className="ekat-header__logo-name">
                        e-KAT
                </span>
                    <span className="ekat-header__logo-name-mode">
                        buyer
                </span>
                    {/*<LogoSvg />*/}
                </Link>
            </div>
        );
    }

    return (
        <div className="ekat-header__logo">
            {logo}
        </div>
    );
}

LogoPanel.propTypes = {
    /** one of ['default', 'mobile'] (default: 'default') */
    layout: PropTypes.oneOf(['default', 'mobile']),
};

LogoPanel.defaultProps = {
    layout: 'default',
};

export default LogoPanel;
